using JetBrains.Annotations;
using source._2900._2938;

namespace test._2900;

[TestClass]
[TestSubject(typeof(Solution))]
public class Test2938
{
    [TestMethod]
    public void normal_case()
    {
        var solution = new Solution();
        string s = "101";
        Assert.AreEqual(1, solution.MinimumSteps(s));

        s = "100";
        Assert.AreEqual(2, solution.MinimumSteps(s));

        s = "0111";
        Assert.AreEqual(0, solution.MinimumSteps(s));
    }

    [TestMethod]
    public void overflow_case()
    {
        string s =
            "";

        Solution solution = new();
        Assert.AreEqual(2500000000, solution.MinimumSteps(s));
    }
}